import React, {Component} from 'react'; 
import {Link} from 'react-router-dom';
import logo from '../IMG/logo.png';

class cabeza extends Component{
    state={};

    render(){
        return(
            <div className="arriba">                
                <header>  
                    < Link to="/"> 
                    <img src={logo} width={80} height={80}/> 
                    </Link>                                                        
                </header>
            </div>

        )
    }
}
export default cabeza;
